import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Routes } from "react-router-dom";
//import App from "./App";
//import Home from "./Home";
import App from "./App";

ReactDOM.render(
  <BrowserRouter>
  <Routes>
    <Route>
      <Route/>
    </Route>
  </Routes>
    <App />
  </BrowserRouter>,
  document.getElementById("root")
);
